// ===============================
// Validar Entrada ‚Äî vers√£o corrigida
// ===============================

const input = $input.first().json;

// üîí Campos obrigat√≥rios (AGORA COMPLETOS)
const required = [
  'client_id',
  'whatsapp_id',
  'document_name',
  'document_mime'
];

const missing = required.filter(field => !input[field]);

if (missing.length > 0) {
  throw new Error(`Campos obrigat√≥rios faltando: ${missing.join(', ')}`);
}

// üîç Verificar base64 OU url
const temBase64 = Boolean(
  input.document_base64 &&
  typeof input.document_base64 === 'string' &&
  input.document_base64.trim() !== ''
);

const temUrl = Boolean(
  input.document_url &&
  typeof input.document_url === 'string' &&
  input.document_url.trim() !== ''
);

if (!temBase64 && !temUrl) {
  throw new Error('√â necess√°rio fornecer document_base64 OU document_url');
}

// üìÑ Tipos suportados
const supportedTypes = [
  'application/pdf',
  'application/msword',
  'application/vnd.openxmlformats-officedocument.wordprocessingml.document',
  'text/plain'
];

if (!supportedTypes.includes(input.document_mime)) {
  return [{
    json: {
      erro: 'Tipo de arquivo n√£o suportado',
      tipo_recebido: input.document_mime,
      telefone: input.telefone,
      deve_notificar_usuario: true
    }
  }];
}

// ‚úÖ Retorno PADR√ÉO e CONSISTENTE
return [{
  json: {
    client_id: input.client_id,
    whatsapp_id: input.whatsapp_id,
    telefone: input.telefone,
    instance: input.instance,
    client_name: input.client_name,

    // ‚ö†Ô∏è MANT√âM OS NOMES ORIGINAIS
    document_url: temUrl ? input.document_url : null,
    document_base64: temBase64 ? input.document_base64 : null,

    document_name: input.document_name,
    document_mime: input.document_mime,
    document_size: input.document_size,
    caption: input.document_caption || '',
    message_timestamp: input.message_timestamp,

    usa_base64: temBase64
  }
}];

// ============================================
