// Fun√ß√£o SHA256 em JavaScript puro (sem m√≥dulo crypto)
function sha256(str) {
  const utf8 = unescape(encodeURIComponent(str));
  const bytes = [];
  for (let i = 0; i < utf8.length; i++) {
    bytes.push(utf8.charCodeAt(i));
  }

  const K = [0x428a2f98,0x71374491,0xb5c0fbcf,0xe9b5dba5,0x3956c25b,0x59f111f1,0x923f82a4,0xab1c5ed5,0xd807aa98,0x12835b01,0x243185be,0x550c7dc3,0x72be5d74,0x80deb1fe,0x9bdc06a7,0xc19bf174,0xe49b69c1,0xefbe4786,0x0fc19dc6,0x240ca1cc,0x2de92c6f,0x4a7484aa,0x5cb0a9dc,0x76f988da,0x983e5152,0xa831c66d,0xb00327c8,0xbf597fc7,0xc6e00bf3,0xd5a79147,0x06ca6351,0x14292967,0x27b70a85,0x2e1b2138,0x4d2c6dfc,0x53380d13,0x650a7354,0x766a0abb,0x81c2c92e,0x92722c85,0xa2bfe8a1,0xa81a664b,0xc24b8b70,0xc76c51a3,0xd192e819,0xd6990624,0xf40e3585,0x106aa070,0x19a4c116,0x1e376c08,0x2748774c,0x34b0bcb5,0x391c0cb3,0x4ed8aa4a,0x5b9cca4f,0x682e6ff3,0x748f82ee,0x78a5636f,0x84c87814,0x8cc70208,0x90befffa,0xa4506ceb,0xbef9a3f7,0xc67178f2];

  let h = [0x6a09e667,0xbb67ae85,0x3c6ef372,0xa54ff53a,0x510e527f,0x9b05688c,0x1f83d9ab,0x5be0cd19];

  bytes.push(0x80);
  while (bytes.length % 64 !== 56) bytes.push(0x00);
  const bitLength = (utf8.length * 8);
  for (let i = 7; i >= 0; i--) bytes.push((bitLength >>> (i * 8)) & 0xff);

  const rightRotate = (value, amount) => (value >>> amount) | (value << (32 - amount));
  const toHex = (v) => ('00000000' + v.toString(16)).slice(-8);

  for (let chunk = 0; chunk < bytes.length; chunk += 64) {
    const w = [];
    for (let i = 0; i < 16; i++) {
      w[i] = (bytes[chunk + i * 4] << 24) | (bytes[chunk + i * 4 + 1] << 16) | (bytes[chunk + i * 4 + 2] << 8) | bytes[chunk + i * 4 + 3];
    }
    for (let i = 16; i < 64; i++) {
      const s0 = rightRotate(w[i-15], 7) ^ rightRotate(w[i-15], 18) ^ (w[i-15] >>> 3);
      const s1 = rightRotate(w[i-2], 17) ^ rightRotate(w[i-2], 19) ^ (w[i-2] >>> 10);
      w[i] = (w[i-16] + s0 + w[i-7] + s1) >>> 0;
    }
    let [a,b,c,d,e,f,g,h0] = h;
    for (let i = 0; i < 64; i++) {
      const S1 = rightRotate(e, 6) ^ rightRotate(e, 11) ^ rightRotate(e, 25);
      const ch = (e & f) ^ ((~e) & g);
      const temp1 = (h0 + S1 + ch + K[i] + w[i]) >>> 0;
      const S0 = rightRotate(a, 2) ^ rightRotate(a, 13) ^ rightRotate(a, 22);
      const maj = (a & b) ^ (a & c) ^ (b & c);
      const temp2 = (S0 + maj) >>> 0;
      h0 = g; g = f; f = e; e = (d + temp1) >>> 0; d = c; c = b; b = a; a = (temp1 + temp2) >>> 0;
    }
    h[0] = (h[0] + a) >>> 0; h[1] = (h[1] + b) >>> 0; h[2] = (h[2] + c) >>> 0; h[3] = (h[3] + d) >>> 0;
    h[4] = (h[4] + e) >>> 0; h[5] = (h[5] + f) >>> 0; h[6] = (h[6] + g) >>> 0; h[7] = (h[7] + h0) >>> 0;
  }

  return h.map(toHex).join('');
}

// Pegar dados do cliente (adaptado para WhatsApp)
const clienteInfo = $('Validar Entrada').first().json;

// Pegar texto de diferentes fontes
let texto = '';
try {
  texto = $input.first().json.data || 
          $input.first().json.text ||
          $input.first().json['concatenated_data'] ||
          '';
} catch (e) {
  texto = '';
}

// Pegar metadados do arquivo
const fileName = (clienteInfo.file_name || '').toLowerCase();

// ============================================
// 1. LIMPAR TEXTO (mais agressivo)
// ============================================
const textoLimpo = texto
  .replace(/\r\n/g, '\n')                   // Normaliza quebras
  .replace(/\t+/g, ' ')                     // Tabs ‚Üí espa√ßo
  .replace(/\s+/g, ' ')                     // M√∫ltiplos espa√ßos ‚Üí 1
  .replace(/\n{3,}/g, '\n\n')               // Max 2 quebras
  .replace(/[^\w\s√Ä-√ø.,;:!?()@#$%&*\-+=\n\/¬∞¬∫]/g, '') // Remove lixo
  .replace(/_{3,}/g, '---')                 // Underlines ‚Üí separador
  .trim();

// ============================================
// VALIDA√á√ÉO DE TAMANHO M√çNIMO
// ============================================
if (textoLimpo.length < 50) {
  return {
    json: {
      erro: 'Documento muito curto',
      tamanho: textoLimpo.length,
      minimo: 50,
      telefone: clienteInfo.telefone,
      deve_notificar_usuario: true
    }
  };
}

// ============================================
// 2. CATEGORIZAR (expandido)
// ============================================
let categoria = 'geral';

const categorias = {
  'financeiro': /preco|pre√ßo|tabela|orcamento|or√ßamento|valor|custo|financ|pagamento|investimento|fatura|boleto/,
  'produto': /produto|catalogo|cat√°logo|servico|servi√ßo|ficha|especifica|funcionalidade|caracteristica/,
  'faq': /faq|duvida|d√∫vida|pergunta|frequente|ajuda|suporte/,
  'processo': /processo|manual|procedimento|fluxo|passo|instruc|como_fazer|tutorial|guia/,
  'contato': /contato|telefone|email|equipe|endereco|endere√ßo|horario|hor√°rio/,
  'contrato': /contrato|termo|acordo|clausula|cl√°usula|politica|pol√≠tica|regulamento/,
  'receitas': /receita|ingrediente|preparo|culinaria|culin√°ria|bolo|torta|comida|cozinha/,
  'documentos': /documento|contrato|acordo|termo|clausula|cl√°usula/,
  'lembretes': /lembrete|tarefa|aviso|nota|anotacao|anota√ß√£o/,
  'relatorios': /relat√≥rio|relatorio|an√°lise|analise|relato|resumo/
};

for (const [cat, regex] of Object.entries(categorias)) {
  if (regex.test(fileName) || regex.test(textoLimpo.substring(0, 500).toLowerCase())) {
    categoria = cat;
    break;
  }
}

// ============================================
// 3. GERAR HASH DO CONTE√öDO (SHA256)
// ============================================
const contentHash = sha256(textoLimpo);

// ============================================
// 4. EXTRAIR T√çTULO
// ============================================
const titulo = (clienteInfo.caption || clienteInfo.file_name || 'Documento sem t√≠tulo')
  .replace(/\.[^/.]+$/, '')  // Remove extens√£o
  .replace(/_/g, ' ')        // Underscores ‚Üí espa√ßos
  .replace(/-/g, ' ')        // H√≠fens ‚Üí espa√ßos
  .replace(/\s+/g, ' ')      // Normaliza espa√ßos
  .trim();

// ============================================
// 5. TIPO DO ARQUIVO
// ============================================
let tipoArquivo = 'outro';
const mimeType = clienteInfo.file_mime || '';
if (mimeType.includes('pdf')) tipoArquivo = 'pdf';
else if (mimeType.includes('spreadsheet') || mimeType.includes('excel')) tipoArquivo = 'planilha';
else if (mimeType.includes('document') || mimeType.includes('word') || mimeType.includes('msword')) tipoArquivo = 'documento';
else if (mimeType.includes('text')) tipoArquivo = 'texto';

// ============================================
// RETORNO (formato compat√≠vel com workflow atual)
// ============================================
return {
  json: {
    // Campos obrigat√≥rios para o workflow
    client_id: clienteInfo.client_id,
    client_name: clienteInfo.client_name,
    whatsapp_id: clienteInfo.whatsapp_id,
    telefone: clienteInfo.telefone,
    instance: clienteInfo.instance,

    // Conte√∫do processado
    content: textoLimpo,
    content_hash: contentHash,
    document_hash: contentHash,  // Hash do documento original (igual ao content_hash)

    // Metadados do documento
    titulo: titulo,
    categoria: categoria,
    fonte: 'whatsapp',
    file_type: clienteInfo.file_mime,
    file_name: clienteInfo.file_name,
    autor: clienteInfo.client_name,

    // Estat√≠sticas
    char_count: textoLimpo.length,
    original_filename: clienteInfo.file_name,
    processed_at: new Date().toISOString(),

    // Metadata adicional (para compatibilidade)
    metadata: {
      file_size: clienteInfo.file_size,
      whatsapp_id: clienteInfo.whatsapp_id,
      caption: clienteInfo.caption || '',
      uploaded_at: new Date().toISOString(),
      tipo_arquivo: tipoArquivo,
      version: '3.0'
    }
  }
};

// Preparar dados para o Document Loader
const processado = $('Processar Texto').first().json;

// Retornar apenas o conte√∫do como string
return {
  json: {
    content: processado.content,
    metadata: {
      whatsapp_id: processado.whatsapp_id,
      document_hash: processado.document_hash,
      categoria: processado.categoria,
      fonte: processado.fonte,
      file_type: processado.file_type,
      autor: processado.autor,
      content_hash: processado.content_hash
    }
  }
};

// Busca os dados l√° do in√≠cio para n√£o perder o arquivo
const item = $('Validar Entrada').first().json;
let base64 = item.document_base64 || '';

// Se o base64 vier com o prefixo "data:...base64,", n√≥s removemos
// pois o n8n precisa apenas do c√≥digo puro para criar o arquivo corretamente
if (base64.includes('base64,')) {
  base64 = base64.split('base64,')[1];
}

return [{
  json: {
    ...item,
    document_base64: base64
  }
}];

const limite = $('Verificar Limite RAG').first().json.resultado;
const clientInfo = $('Validar Entrada').first().json;

return [{
  json: {
    whatsapp_id: clientInfo.whatsapp_id,
    telefone: clientInfo.telefone,
    erro: 'limite_atingido',
    mensagem_formatada: `üö´ *LIMITE DE DOCUMENTOS ATINGIDO!*\n\n` +
                       `Voc√™ atingiu o limite de ${limite.limite} consultas RAG/m√™s.\n\n` +
                       `Para continuar usando documentos:\n` +
                       `Digite *#planos* para fazer upgrade! üöÄ`,
    deve_notificar_usuario: true
  }
}];

// Processar resultado da verifica√ß√£o de duplicata
const resultado = $input.all(); // Pega todos os itens retornados pelo banco

// Se o banco retornou alguma linha, significa que o documento J√Å EXISTE
const existe = resultado.length > 0 && !!resultado[0].json.id;

return {
  json: {
    existe: existe,
    // Se existe, repassa os dados do documento encontrado
    ...(existe ? resultado[0].json : {})
  }
};
